import style from "./Card.module.css";
const Card =(name, background_image, genres)=>{
    return (
        <div className={style.card}>
            <p>{name}</p>
            <img src={background_image} alt="img not found"
            width="250px" height="250px"/>
            <p>{genres}</p>
        </div>
    )

}
export default Card;
